CREATE DATABASE IF NOT EXISTS employeestatus_balance;
USE employeestatus_balance;
DROP TABLE IF EXISTS employee_status;
CREATE TABLE employee_status (
        emp_id INT PRIMARY KEY AUTO_INCREMENT,
        emp_name VARCHAR(100),
        department VARCHAR(50),
        country VARCHAR(50),
        region VARCHAR(50),
        state VARCHAR(50),
        status VARCHAR(20),
        email VARCHAR(100),
        phone_number VARCHAR(15),
        joining_date DATE,
        last_updated TIMESTAMP
    );
select * from employee_status;
SELECT DISTINCT country FROM employee_status;
